import classes from './Card.module.css';

//when we want to wrap JSX content in custom component, we use props

//props.children is a special prop that every component recieves by default, and children always holds the content which is passed between the opening and closing of the component tags

function Card(props) {
  return <div className={classes.card}>{props.children}</div>;
}

export default Card;
